    str += tmpStr;
    snprintf(tmpStr, 1000, "%sznum = %d\n", prefix, atts->GetZnum());
    str += tmpStr;
    snprintf(tmpStr, 1000, "%stensorSupportVariable = \"%s\"\n", prefix, atts->GetTensorSupportVariable().c_str());
